import React from 'react';

class AsteroidList extends React.Component {
    constructor(props) {
        super(props)

    }


    render = () => {
        const AsteroidMarkup = (this.props.asteroids.length > 0 &&
            this.props.asteroids.map(asteroid => {
                return (
                    <li className="list-group-item" data-asteroid-id={asteroid.id} key={asteroid.id}>
                        <div className="d-flex justify-content-between align-items-center">
                            <p className="m-0">{asteroid.name}</p>
                        </div>
                    </li>
                )

            }
            )
        )
        return (
            <div className="row mt-5 justify-content-center">
                <div className="col-sm-5">
                    <p> Asteroids on 2015-09-07: </p>
                    <ul className="list-group">
                        {AsteroidMarkup}
                    </ul>
                </div>
            </div>
        )

    }
}

export default AsteroidList;
